const keypad = [
  [0, 0, 1, 0, 0],
  [0, 2, 3, 4, 0],
  [5, 6, 7, 8, 9],
  [0, 'A', 'B', 'C', 0],
  [0, 0, 'D', 0, 0],
]
const instructions = [
  '',
  '',
  '',
  '',
  '',
]
const finger = [2, 0]
const buttons = []
let code = ''

instructions.forEach(commands => {
  commands.split('').forEach(command => {
    if (
      command === 'U' &&
      finger[0] > 0 &&
      keypad[finger[0] - 1][finger[1]] !== 0
    )
      finger[0] -= 1
    if (
      command === 'D' &&
      finger[0] < 4 &&
      keypad[finger[0] + 1][finger[1]] !== 0
    )
      finger[0] += 1
    if (
      command === 'L' &&
      finger[1] > 0 &&
      keypad[finger[0]][finger[1] - 1] !== 0
    )
      finger[1] -= 1
    if (
      command === 'R' &&
      finger[1] < 4 &&
      keypad[finger[0]][finger[1] + 1] !== 0
    )
      finger[1] += 1
  })
  buttons.push(finger.slice())
})

buttons.forEach(button => {
  code += keypad[button[0]][button[1]]
})

console.log(`Bathroom Code: ${code}`)
